import React from "react";
// import { useParams } from "react-router";
import charList from "../CharactersPage/characterList";
import "../CharactersPage/CharacterPage/CharacterPage.css";
import ContentWrapper from "./HomePage.style.js";

const homePage = () => {
  const { id } = useParams();
  const char = charList.filter(char => char.id === id)[0];
  const { name, photo, who, why } = char;

  return (
    <ContentWrapper>
      <div className="Banner">
        <div className="BannerTextContainer">
          <span>Designed & Developed by Haley Park</span>
          <br></br>
          <span>Inspired by </span>
          <a href="">this youtube video</a>
        </div>
      </div>
      <br />

      <div className="container">
        <h1 className="deco">x</h1>
        <h1>Concierge</h1>

        <div className="row">
          <div className="col-lg-4 col-md-6 col-sm-12">
            <img style={{ width: "100%" }} src={photo} alt={name} />
          </div>
          <div className="col-lg-8 col-md-6 col-sm-12">
            <h1 className="CharacterName">{name}</h1>
            <br />
            <br />

            <h4>Who?</h4>
            {who.map((p, idx) => {
              return <p key={idx}>{p}</p>;
            })}
            <h4>Why?</h4>
            {why.map((p, idx) => {
              return <p key={idx}>{p}</p>;
            })}
          </div>
        </div>
      </div>
    </ContentWrapper>
  );
};

export default homePage;
